import UploadFileIcon from '@mui/icons-material/UploadFile';
import './App.css';
import Grid from '@material-ui/core/Grid';
import { Checkbox } from '@mui/material';
import { Button } from '@mui/material';
import React, { Component } from 'react';
import Popup from './Popup.js'

class Upload extends React.Component {
    constructor() {
        super();
        this.state = {
          showPopup: false
        };
      }
      togglePopup() {
        this.setState({
          showPopup: !this.state.showPopup
        });
      }
    render() {

  return (  
     <container>
    <Grid id="iconsPosition" container>
    <Grid xs={1}>  </Grid>

    <Grid xs={1}> <Checkbox id="checkboxPosition"/> <UploadFileIcon id="icon"></UploadFileIcon>
  </Grid>
    <Grid xs={1}>  <Checkbox id="checkboxPosition"/>  <UploadFileIcon id="icon"></UploadFileIcon></Grid>
    <Grid xs={1}> <Checkbox id="checkboxPosition"/>  <UploadFileIcon id="icon"></UploadFileIcon></Grid>
    <Grid xs={1}> <Checkbox id="checkboxPosition"/>  <UploadFileIcon id="icon"></UploadFileIcon></Grid>
    <Button onClick={this.togglePopup.bind(this)} id="UploadButton" variant="outlined">Upload Selected Files </Button>
   <div> {this.state.showPopup ? 
          <Popup
            text='Close Me'
            closePopup={this.togglePopup.bind(this)}
          />
          : null
        }
        </div>
    </Grid>

    </container>

  );
}
}
export default Upload;
